const Review = () => {
  return (
    <>
      <section className="Review">
        <div className="container review">
          <div className="view">
            <h1>What Our Users Say </h1>
            <p>
              Start working with Trench that can provide everything you need to
              generate
              <br /> awareness, drive traffic, connect.
            </p>
          </div>
        </div>
      </section>
    </>
  );
};
export default Review;
